import { Button } from "@mui/material";
import React from "react";

const Login = () => {
  return (
    <div className=" grid place-items-center h-screen w-[100%]">
      <img
        src="https://upload.wikimedia.org/wikipedia/en/thumb/9/98/Discord_logo.svg/233px-Discord_logo.svg.png"
        alt="Discord-Logo"
      />
      <Button className="w-72 bg-[#6175bc] text-[#eff2f5]">Sign-In</Button>
    </div>
  );
};

export default Login;
